comment:
대학만화전 떨어진작품들보면 작품성도좋고 그림체도좋은데 떨어진작품 태반인거 모르나 네이버는? 솔찍히 내용은 ㄱㅊ은데 그림체때문에;; 이비스나 사이툴이나 메디방 갓 입문한사람들급으로 못그리는데.... 명암넣는거도 1차만넣고 2차3차는 팔아먹었네;;
웹툰작가가 꿈인데 이런작품들이 네이버입문할때마다(퀄기준, 쥬니/임총이 갑이었고 그담은 이거/조안나...) 신기함.... 
이러다 웹툰포털대표자리뺏긴다? 카페랑 다음 바로뒤에붙어있는거안보이냐?? 작품선정좀 제발 정신차려라

아니 인정할건인정하자니까 왜 니가 그려서 올려 이런 말만 무한반복임;;
작가님 그림이 미숙한건 사실이잖
그림이아니라 비판 혐오에 하지말라는 이야기에서 왜 그런 싸움이 될 말로 넘어감

기안84 패션왕 연재할 때 그림 못 그려서 그림 학원에서 선생 못 했다는 썰은 아심?
웹툰 특성상 진짜 그림보다 중요한 게 있음. 글고 전문가 아니고 네이버 웹툰 다 챙겨보는 독자로서 그림체나 실력 심각하게 모자라보이진 않는데 작가님이.
거슬리면 욕 하는 게 아니라 안 보면 됨... 모든 게 평화롭게 잘 돌아갈텐데 내용도 좋은 웹툰에서 뭐라고 이러쿵 저러쿵 거려 걍 보지 마 그럼;

자까님 까는건 아닌데 
애초부터 웹툰에서 신체골격이 뭔상관임;;;
그럼 대학일기는 2등신이고 놓정도 2등신인데
신체골격은 개뿔;;;

아니 이정도면 만화 제대로 본거 맞음?
여자친구는 2화에 통화할때 여주가 듣고 생각한거고
민증은 지갑주워서 찾아줄라고 본거지 훔쳐본거냐;;

;이거만 붙이면 완전 띠거워짐 예를들면


